import { Result } from 'antd';
import { basePath, apiVersion } from './config';

export function getCoursesApi() {
    const url = `${basePath}/${apiVersion}/get-course`;

    return fetch(url)
        .then(response => {
            return response.json()
        })
        .then(result => {
            return result
        })
        .catch(err => err)
}
